// /components/GuestRoom.js
import React, { useEffect, useRef, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import io from 'socket.io-client';

const socket = io('http://localhost:5000');

function GuestRoom() {
  const { roomId } = useParams();
  const navigate = useNavigate();
  const [name, setName] = useState('');
  const [joined, setJoined] = useState(false);
  const [muted, setMuted] = useState(false);

  const localVideoRef = useRef();
  const remoteVideoRef = useRef();
  const localStreamRef = useRef();
  const peerConnectionRef = useRef(null);

  useEffect(() => {
    if (joined) {
      socket.emit('join-room', { roomId, name });

      socket.on('offer', async ({ offer }) => {
        peerConnectionRef.current = createPeerConnection();

        await peerConnectionRef.current.setRemoteDescription(new RTCSessionDescription(offer));
        const answer = await peerConnectionRef.current.createAnswer();
        await peerConnectionRef.current.setLocalDescription(answer);

        socket.emit('answer', { answer });
      });

      socket.on('ice-candidate', async ({ candidate }) => {
        if (peerConnectionRef.current) {
          try {
            await peerConnectionRef.current.addIceCandidate(new RTCIceCandidate(candidate));
          } catch (err) {
            console.error('Error adding received ICE candidate', err);
          }
        }
      });
    }
  }, [joined]);

  const createPeerConnection = () => {
    const pc = new RTCPeerConnection({
      iceServers: [{ urls: 'stun:stun.l.google.com:19302' }],
    });

    localStreamRef.current.getTracks().forEach(track => pc.addTrack(track, localStreamRef.current));

    pc.ontrack = (event) => {
      remoteVideoRef.current.srcObject = event.streams[0];
    };

    pc.onicecandidate = (event) => {
      if (event.candidate) {
        socket.emit('ice-candidate', { candidate: event.candidate });
      }
    };

    return pc;
  };

  const handleJoin = async () => {
    try {
      const stream = await navigator.mediaDevices.getUserMedia({ video: true, audio: true });
      localVideoRef.current.srcObject = stream;
      localStreamRef.current = stream;
      setJoined(true);
    } catch (err) {
      console.error('Error accessing media devices.', err);
    }
  };

  const handleLeave = () => {
    if (peerConnectionRef.current) {
      peerConnectionRef.current.close();
    }
    if (localStreamRef.current) {
      localStreamRef.current.getTracks().forEach(track => track.stop());
    }
    socket.disconnect();
    navigate('/');
  };

  const toggleMute = () => {
    const audioTrack = localStreamRef.current.getAudioTracks()[0];
    if (audioTrack) {
      audioTrack.enabled = !audioTrack.enabled;
      setMuted(!audioTrack.enabled);
    }
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-black text-white">
      <h1 className="text-3xl font-bold mb-6 text-yellow-400">Ve Meet - Guest</h1>

      {!joined ? (
        <div className="bg-gray-900 p-6 rounded-2xl shadow-lg">
          <input
            type="text"
            placeholder="Enter your name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            className="mb-4 p-2 rounded w-full text-black"
          />
          <button
            onClick={handleJoin}
            className="bg-yellow-400 text-black px-6 py-2 rounded hover:bg-yellow-500 transition"
          >
            Join Now
          </button>
        </div>
      ) : (
        <div className="flex flex-col items-center">
          <div className="grid grid-cols-2 gap-4 mb-6">
            <div>
              <p className="text-green-400 text-sm mb-1">You</p>
              <video ref={localVideoRef} autoPlay playsInline muted className="rounded-xl w-80" />
            </div>
            <div>
              <p className="text-blue-400 text-sm mb-1">Host</p>
              <video ref={remoteVideoRef} autoPlay playsInline className="rounded-xl w-80" />
            </div>
          </div>

          <div className="flex gap-4">
            <button
              onClick={toggleMute}
              className="bg-gray-800 px-4 py-2 rounded-xl hover:bg-gray-700"
            >
              {muted ? 'Unmute' : 'Mute'}
            </button>
            <button
              onClick={handleLeave}
              className="bg-red-600 px-4 py-2 rounded-xl hover:bg-red-500"
            >
              Leave Meeting
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default GuestRoom;
